Art. 5o Compete à Diretoria de Fomento ao Turismo:
I - coordenar, supervisionar e orientar atividades relacionadas à
captação de recursos, ao fomento ao empreendedorismo, marketing
e à promoção do turismo do Estado de Goiás, estudos, pesquisas e
qualificação, ações e projetos de desenvolvimento da gastronomia
goiana, ações e projetos de eventos, políticas e ações integradas do
turismo e à estruturação de destinos turísticos;
II - auxiliar no planejamento, na coordenação, no acompanhamento
e na avaliação da Política Estadual de Turismo;
III - coordenar e subsidiar a elaboração de relatórios das ações de
governo, relativos à sua competência;
IV - promover ações que fomentem a inovação e utilização de novas
tecnologias no setor do turismo;
V - orientar, acompanhar e supervisionar a execução dos projetos
e programas regionais de desenvolvimento do turismo, infraestrutura turística, financiamento, fomento e captação de investimento
nacional e estrangeiro para o setor de turismo;
VI - promover a cooperação e articulação com os órgãos e as
entidades da administração pública federal, estadual, distrital e
municipal, do setor produtivo e do terceiro setor, em projetos que
possam contribuir para o fortalecimento e desenvolvimento do
turismo estadual;
VII - propor alternativas e avaliar medidas, em articulação com
demais órgãos e entidades relacionados, visando ao aprimoramento do ambiente jurídico-institucional, objetivando a estruturação e o
ordenamento do turismo nas regiões e áreas prioritárias para o seu
desenvolvimento;
VIII - promover oportunidades geradoras de captação de recursos
financeiros, para implementação de projetos turísticos;
IX - acompanhar e orientar, quanto ao cumprimento dos requisitos
técnicos, a execução de convênios e instrumentos congêneres, para
aporte de recursos aos municípios, na elaboração e implementação
de planos e projetos dos programas de desenvolvimento do turismo;
X - articular a implementação da política de qualificação do setor de
turismo;
